import React, { useState, useEffect } from 'react';
import { Container, Paper, Grid, Typography, Avatar, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { LiveTv, PlaylistPlay, ViewQuilt, MoreHoriz, Settings, ExitToApp } from '@mui/icons-material';
import axios from 'axios';

const App = () => {
  const [userData, setUserData] = useState({ username: 'John Doe', avatar: '' });

  useEffect(() => {
    axios
      .get('https://jsonplaceholder.typicode.com/users/1')
      .then((response) => {
        setUserData({ ...response.data, showDetails: false });
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);

  return (
    <Container
      sx={{

        minHeight: '100vh',
        background: '#111115',
        padding: 0,
        margin: 0,

      }}
    >
      <Grid container sx={{ flex: 1, overflow: 'hidden' }}>
        <Grid item xs={2.5}>
          {/* Sidebar 1 - Logo */}
          <Paper
            sx={{
              height: '100vh',
              width: '10vw',
              background: '#151515',
            }}
          >
            {/* Your logo */}
          </Paper>
        </Grid>
        <Grid item xs={2.5}>
          {/* Sidebar 2 - User Info and Navigation */}
          <Paper
            sx={{
              height: '100vh',
              background: '#0D0D0F',
              padding: '16px',
              color: 'white',
            }}
          >
            <div
              sx={{
                display: 'flex',
                alignItems: 'center',
              }}
            >
              <div sx={{ marginRight: '50px', marginLeft: 'auto' }}>
                {userData.name}
              </div>
              <Avatar sx={{ cursor: 'pointer' }}>
                {userData.name ? userData.name[0] : 'U'}
              </Avatar>
            </div>
            <List>
              <ListItem button>
                <ListItemIcon>
                  <LiveTv />
                </ListItemIcon>
                <ListItemText primary="Live" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <PlaylistPlay />
                </ListItemIcon>
                <ListItemText primary="Sequence" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ViewQuilt />
                </ListItemIcon>
                <ListItemText primary="Layout" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <MoreHoriz />
                </ListItemIcon>
                <ListItemText primary="More" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <Settings />
                </ListItemIcon>
                <ListItemText primary="Settings" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ExitToApp />
                </ListItemIcon>
                <ListItemText primary="Logout" />
              </ListItem>
            </List>
          </Paper>
        </Grid>
        <Grid item xs={7}>
          {/* Main Content */}
        </Grid>
      </Grid>
    </Container>
  );
};

export default App;
